(1, 1, 1, 'Bonjour Hanen,\r\n\r\nPour le point 1 susmentionné , vous pourriez bien evidement ajouter des nouvelles adresses. Vous devriez tout d\'abord selectionner la gouvernorat, puis selectionner/ajouter  une ville ainsi de suite jusqu\'a arriver aux adresses.\r\n\r\nPour le point 2 : La modification marche correctement. J\'ai changé la valeur de l\'estimation du client du 850,000 au 900,000 et j\'ai rien touché au code.\r\n\r\nPour le point 3 : Les modifications sont en cours de développement. Je vous transmettrrai un message le plutôt possible\r\n\r\nCordialement.', '2017-07-17 09:12:07'),
(2, 2, 1, 'Ce n\'est pas un bug. Le navigateur charge encore l\'image à partir de son cache. Veuillez actualiser la page en appuyant sur la touche Ctrl gauche. ( C\'est une méthode pour vider le cache du navigateur avant de charger la page )', '2017-07-17 09:23:18'),
