INSERT INTO `reclamation` (`id`, `user_id`, `code`, `title`, `description`, `date_creation`, `date_update`, `open`) VALUES
(1, 2, 'REC-2017-1', 'Acquisition', '<p>Bonjour Walid,</p>\r\n\r\n<p>Suite &agrave; mon test pour l&#39;ajout d&#39;un ACQ (Acquisition) j&#39;ai rencontr&eacute;e&nbsp;des bugs et des diffucult&eacute;s.</p>\r\n\r\n<p>1- Quand j&#39;ajoute l&#39;ACQ et je veux faire une modification je ne peux pas faire des modifications que l&#39;estimation client et agence et la description. Par contre je veux faire la modification sur tous les champs.</p>\r\n\r\n<p>2 - Les modifications apport&eacute;es lors de la premi&egrave;re formation doivent &ecirc;tre ajout&eacute;es afin que nous puissions effectuer des tests corrects.</p>\r\n\r\n<p>Cordialement</p>', '2017-07-15 10:12:10', '2017-07-15 12:28:05', 0),
(2, 2, 'REC-2017-2', 'Modification de profile', '<p>Rebonjour Walid,</p>\r\n\r\n<p>Pour la&nbsp;modification de mon profile j&#39;ai chang&eacute; ma photo elle n&#39;a pa chang&eacute; sur mon poste pourtant j&#39;ai fais plusieurs actualisation de la page...</p>\r\n\r\n<p>j&#39;ai tester du poste de mon coll&eacute;gue j&#39;ai trouver que la modification est faite chez lui. Ce bug &agrave; fixer et &nbsp;&agrave; v&eacute;rifier chez toi.</p>\r\n\r\n<p>Merci d&#39;avance, Cordialement.</p>', '2017-07-15 10:31:30', NULL, 0),
(12, 2, 'REC-2017-3', 'Des bugs à Fixer dans l\'enregistrement du client et acquisition', '<p>bonjour</p>\r\n\r\n<p>Il ya des erreurs lors de l&#39;enregistrement du client.</p>\r\n\r\n<p>Il ya des erreurs lors de transfert du nouvelle vers acquisition.</p>\r\n\r\n<p>Cordialement</p>', '2017-07-20 10:09:24', NULL, 0),
(19, 3, 'REC-2017-13', 'Tableau de bord', '<p>Bonjour Walid,&nbsp;</p>\r\n\r\n<p>Rien ne s&#39;affiche sur le tableau de bord meme si tout les champs sont bien rempli.</p>\r\n\r\n<p>Chadia&nbsp;</p>', '2017-08-09 11:31:39', NULL, 1),
(20, 14, 'REC-2017-20', 'test', 'test', '2017-09-11 13:01:00', NULL, 1),
(21, 6, 'REC-2017-21', 'Tableau de bord', '<p>le tableau de bord n&#39;enregistre pas les rdv, j&#39;ai fait l&#39;essai &agrave; plusieurs reprise</p>', '2017-09-12 09:20:46', '2017-09-12 09:32:03', 0),
(22, 5, 'REC-2017-22', 'mandat', '<p>probleme d&#39;insertion mandat en enregistrement</p>', '2017-09-13 11:25:04', NULL, 1),
(23, 3, 'REC-2017-23', 'Etat initial de requête', '<p>Suite &agrave; notre disscussion t&eacute;l&eacute;phonique pour cr&eacute;ation de colonne &quot;Etat Initial de requete&quot; sois 1: En cours, 2: Echus, 3: Conclus&nbsp;</p>', '2017-09-14 16:03:22', NULL, 0);
